import React from "react";
import { Link } from "react-router-dom";
const Layout = () => {
    return (
        <>

            <nav class="navbar navbar-expand-md bg-dark navbar-dark fixed-top ">
                <div class="collapse navbar-collapse justify-content-center " id="thetarget">
                    <ul class="navbar-nav ">
                        <li class="nav-item mx-3"><Link class="nav-link text-white font-weight-bold red " to="/html">HTML</Link></li>
                        <li class="nav-item mx-3"><Link class="nav-link text-white font-weight-bold red " to="/css">CSS</Link></li>
                        <li class="nav-item mx-3"><Link class="nav-link text-white font-weight-bold red" to="/javascript">JavaScript</Link></li>
                    </ul>
                </div>
            </nav>
        </>
    )
};
export default Layout;
